    //console.log(searchUrl);
    return (
        <div style={{height:"20rem"}} className="mapouter">
          <div className="gmap_canvas">
            <iframe
              title={address}
              src={searchUrl}
              width="100%"
              height="100%"
              id="gmap_canvas"
              frameBorder="0"
              scrolling="no"
              marginHeight="0"
              marginWidth="0"
            />
          </div>
        </div>
    )
}

export default Map;
